import { AnyAction } from "redux";
import {
  FETCH_BOOKMARKS,
  FETCH_PLANNED_MODS,
  FETCH_PERSONAL_REVIEWS,
} from "../constants";
import { PersonalModulesState } from "../types";


export const fetchBookmarks = (searchTerm) => {
    return { type: SEARCH_TERM, payload: searchTerm };
}

export const fetchPlannedMods = (searchTerm) => {
    return { type: SEARCH_TERM, payload: searchTerm };
}


export const fetchPersonalReviews = (searchTerm) => {
    return { type: SEARCH_TERM, payload: searchTerm };
}
